import React from 'react';


function NavBar(props) {
  return (
    <div>
        <nav>
          <div className="logo"> Closet Nav</div>
          <ul className="nav-links">
            <li><a>Home</a></li>
            <li><a>About</a></li>
            <li><a>Contact</a></li>
            <li><a>Log in</a></li>
            <li><a>Sign Up</a></li>
          </ul>
        </nav>
    </div>
  );
}

export default NavBar;
